import React from 'react';
import styled from 'styled-components';

const Nav = () => {
	return (
		<NavContainer>
			<div className="flex-right">
				<ul className="nav-list">
					<li class="nav-item">
						<a href="#">My Account</a>
					</li>
					<li class="nav-item">
						<a href="#">enrevoir</a>
					</li>
				</ul>
			</div>
		</NavContainer>
	);
};

export default Nav;

const NavContainer = styled.nav`
	.nav-list {
		background:black;
		box-shadow:0px 0px 10px;
		margin:0;
		padding:1rem 0;
		diplay:flex;
		justify-content:flex-end;
		align-items:center;
	}	
`;
